var tipuesearch = {"pages": [{'title': 'Weeks', 'text': 'week2-5 \n week6-9 \n week10-14 \n week15-18 \n', 'tags': '', 'url': 'Weeks.html'}, {'title': 'Week2-5', 'text': 'week2 \n 建立個人倉儲和網站 \n 先登入github，將自己的cad2019倉儲建立起來，把201906_fall可攜系統載到隨身碟上，將自己的倉儲git clone到隨身碟上，以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde建立 cmsimde 目錄，把up_dir裡的東西複製到cad2019資料夾，切換到cmsimde的目錄下， 以 python wsgi.py 啟動近端網際伺服器，動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 然後到github上，setting的github pages上，切換到master branch，建立起自己的網站。 \n \n week3 \n solvespace編譯 \n 1.將Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe  2.git clone --recurse-submodules https://github.com/solvespace/solvespace.git solvespace 3.edit Y:\\tmp\\solvespace\\extlib\\angle\\CMakeLists.txt comment out line 713 and 714 #list(APPEND ANGLE_DEFINITIONS #"-DANGLE_PRELOADED_D3DCOMPILER_MODULE_NAMES={ \\"d3dcompiler_47.dll\\", \\"d3dcompiler_46.dll\\", \\"d3dcompiler_43.dll\\" }") endif() 4.接著需要手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 (即隨身系統的 msys64\\mingw64\\lib 目錄): 5.cd solvespace 6.cd extlib 7.cd libpng 8.mkdir build 9.cd build 10.cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release 11.mingw32-make 12.接著回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行: 13.cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release 14.mingw32-make \n \n week4 \n --更新網站-- \n --錄影片所需軟體-- \n \n \xa0 1.\xa0 \xa0\xa0 \xa0 \xa0 \xa0Share-X 用來錄製影片及擷取圖片 \n \n \xa0 2.\xa0 \xa0 \xa0 \xa0 Aegisub 用來上影片字幕 \n \n \xa0 3.\xa0\xa0 \xa0 \xa0Arctime 用來影片跟字幕合併及上浮水印 \n --------------------------------------------------------------------------- \n 自己的浮水印 \n \n week5 \n --solve space操作-- \n 我做的題目是第9個影片，將solve space圖檔匯入到網頁上。 \n \n 操作影片: \n \n', 'tags': '', 'url': 'Week2-5.html'}, {'title': 'Week6-9', 'text': 'week6 \n 1.參數化零組件繪製 \n 成品圖: \n \n \n 2.網際 V-rep 模型控制 \n \n 3.新增啟動與停止按紐 \n \n week7 \n 把solvespace的about編譯成自己的學號 \n \n \n solvespace繪圖驗證1 \n \n 編號1 \n solvespace繪圖驗證3 \n \n 編號3 \n \n week8 \n 啟用 CMSiMDE 中的網誌系統 \n \n 開始導入webots \n \n 以ssh對github連線 \n \n week9 \n \n', 'tags': '', 'url': 'Week6-9.html'}, {'title': 'Week10-14', 'text': 'week10 \n 加入組長建立好的倉儲 \n 下載NX3和NX12並修改步驟 \n \n week12 \n NX12電子書整理 \n Ch2 \n 這個章節介紹的是 NX12 的相關基礎說明，學習開始，理解和使用於建模，製圖等的 NX12 軟件包。它包含五個小節： \n 1. 打開 NX 12 ， 2. 列印，保存和關閉零件文件， 3. 熟悉 NX 12 用戶界面， 4. 使用圖層， 5. 了解重要的命令和對話框。 \n \xa0 2.1  打開 NX12 並打開文件 \n \xa02.1.1 開啟 NX12 \n 在 Windows 桌面屏幕上，單擊開始→程序列表→ Siemens NX 12 →NX 12 \n \n 2.1.2 開啟新檔案 \n ➢ 按新增按鈕 (這在左上) or 按 Ctrl+ N \n 這將打開一個新視窗，詢問要創建的新文件的類型，名稱和位置。NX 12中有多種文件類型，可從位於以下位置的“模板”對話框中選擇窗口的中心。所選文件的屬性顯示在“預覽”下右邊。由於我們要在建模環境中工作並創建新零件，因此僅指定工作環境的單位（英寸或毫米）以及名稱和位置文件。默認單位是毫米。 \n ➢輸入文件的適當名稱和位置，然後單擊“確定”。 \n \n 2.1.3打開零件文件 \n ➢單擊屏幕頂部的打開 (open) 或打開最近的零件按鈕 (open a Recent part) ➢按 Ctrl+O \n 將顯示 “ 打開零件文件 ” 對話框。您可以在右側查看文件預覽 窗口。您可以通過取消單擊 “ 預覽 ” 按鈕前面的框來禁用 “ 預覽 ” 。 \n ➢點擊取消退出窗口 \n \n 2.2 列印，保存和關閉文件 \n 2.2.1 列印NX12圖像 \n ➢ 按下檔案(File) →列印(Print) \n 2.2.2 保存零件文件 \n 必須經常保存工作。如果由於某些原因，NX 12會關閉，而零件沒有保存後，所有工作都會丟失。要保存零件文件。 \n ➢ 按下檔案(File)→儲存(Save) \n 有五個選項可以保存文件： \n 1.儲存 :  創建零件文件時，此選項將使用與以前相同的名稱將零件保存在屏幕上。 \n 2.僅保存工作零件: 此選項僅將活動部件保存在屏幕上。 \n \xa03. 另存為 :  此選項使您可以使用其他名稱和 / 或類型將零件保存在屏幕上。默認類型是.prt. 但是，您可以將文件另存為 IGES (.igs), STEP 203 (.stp), STEP 214 (.step),AutoCAD DXF (.dxf), AutoCAD DWG (.dwg), CATIA Model (.model) and CATIA V5 (.catpart). \n \xa04. 保存全部 :  全部保存此選項將使用現有名稱保存所有打開的零件文件 \n \xa05. 保存書籤 : 保存書籤此選項會將屏幕快照和當前模型的上下文保存為 .JPEG 文件和書籤。 \n 2.3  NX12 介面 \n 通過使用不同的圖標，NX 12的用戶界面變得非常簡單。大部分的可以通過在屏幕上導航鼠標並單擊圖標來執行命令。鍵盤輸入主要限於輸入值和命名文件。 \n 2.3.1 鼠標功能 \n 2.3.1.1 滑鼠左鍵 (MB1) \n 鼠標左鍵（在NX中稱為鼠標鍵1（MB1））用於選擇圖標，菜單，和圖形屏幕上的其他實體。在任何功能上雙擊MB1都會自動打開“編輯對話框”。單擊對像上的MB1，使用戶可以快速訪問如下所示的幾個選項。 \n \n 2.3.1.2 滑鼠中鍵 (MB2) \n 鼠標中鍵（MB2）或滾動按鈕用於通過按下來旋轉對象，按住並拖動。模型也可以繞單個軸旋轉。繞軸旋轉垂直於屏幕，將鼠標指針放在圖形屏幕的右邊緣附近，然後旋轉。同樣，對於垂直軸和垂直於屏幕的軸，單擊底部屏幕的上邊緣和上邊緣分別旋轉。如果您同時按住MB2位置幾秒鐘，它將固定旋轉點（出現橙色圓圈符號）您可以在對象周圍拖動以查看 \n 如果是滾動按鈕，則可以通過滾動對象來放大和縮小。單擊 MB2 將 \n 如果打開了任何彈出窗口或對話框，還可以執行“確定”命令。 \n \n 2.3.1.2 滑鼠右鍵 (MB3) \n MB3或鼠標右鍵用於訪問用戶界面彈出窗口菜單。您可以訪問後續彈出的選項取決於選擇模式和應用。的下圖顯示在Sketch中應用。單擊MB3時選擇功能將提供選項與該功能有關（對象/動作菜單）。 \n \n 單擊MB3並按住按鈕將在功能周圍顯示一組圖標。 \n 這些圖標帶有可應用於功能的可能命令。 \n \n 2.4  圖層 \n \xa0 \n 圖層用於將對象存儲在文件中，並像容器一樣工作以將對象收集到文件中。 \n 有條理和一致的方式。與簡單的視覺工具（例如顯示和隱藏）不同，圖層提供 \n 一種永久的方式來組織和管理文件中對象的可見性和選擇性。 \n 2.4.1 圖層控制 \n 使用 NX 12 ，您可以使用“圖層”控制對像是可見還是可選。一層是 \n NX 12中所有對象必須具有的系統定義的屬性，例如顏色，字體和寬度。那裡 \n NX 12中有 256 個可用層，其中之一始終是工作層。 \n 工作層是在其上創建對象的層，並且始終可見並且可以選擇，而它仍然是工作層。啟動新零件文件時，第 1 層是默認的工作層。當工作層更改為另一種類型的層時，先前的工作層將自動變為“可選”，並且可以然後將其分配為“僅可見”或“不可見”狀態。可以在一層上的對像數量不受限制。您可以自由選擇要創建的圖層對象及其所在層的狀態。要將狀態分配給一個或多個圖層。 \n ➢選擇查看→圖層設置 \n 但是，應該注意的是，在關於層將有利於保持一致性文件之間。 \n \n 2.5  座標系統 \n NX中有不同的坐標系。三軸符號用於辨認坐標系。 \n 2.5.1 絕對座標系統 \n   絕對坐標係是從 所有對像都被引用。這是一個固定的坐標系，  NX 12 建模空間中每個對象的位置和方向是 與這個系統有關。絕對坐標系（或 絕對 CSYS ）還提供了通用的參考框架 零件文件。一個零件文件中 X = 1 ， Y = 1 和 Z = 1 的絕對位置是 任何其他零件文件中的相同位置 \n \xa0 \n 圖形窗口左下角的View Triad僅是視覺對象代表絕對坐標系方向的指示器模型的 \n \n 2.6\xa0 工具欄 \n 工具欄包含圖標，可作為許多功能的快捷方式。右圖正常顯示了工具欄的主要項目 \n 顯示。但是，您可以找到更多不同圖標功能命令，基於所選模塊以及如何模塊是定制的。\xa0 \n ➢右鍵單擊  現有工具欄上的任何位置，都會列出其他工具欄。您可以通過選中添加任何工具欄。 \n \n 通常，默認設置對於大多數操作應該是足夠的，但是在某些操作期間， \n 您可能需要其他工具欄。如果要添加與命令有關的按鈕，工具欄 \n ➢單擊任何工具欄上的下拉箭頭，然後選擇“自定義”。 \n \n 這將彈出一個“自定義”對話框窗口，其中包含所有與命令標籤下的每個工具欄。要添加命令， \n ➢選擇一個類別，然後將命令從“命令”列表中拖動到所需位置。 \n \n 您可以通過以下方式自定義NX 12界面的設置單擊資源欄上的“角色”選項卡。 \n 角色選項卡具有工具欄菜單的不同設置顯示在NX 12界面上。它可以讓你自定義您希望在工具欄中顯示的工具欄介面。 \n', 'tags': '', 'url': 'Week10-14.html'}, {'title': 'Week15-18', 'text': '', 'tags': '', 'url': 'Week15-18.html'}, {'title': 'Note', 'text': '\n \n', 'tags': '', 'url': 'Note.html'}, {'title': 'Solidworks', 'text': '1993年，創始人Jon Hirschtick招募了一個工程師團隊，旨在使3D CAD軟體更容易上手。Hirschtick從廣受好評的麻省理工學院二十一點隊的成員中籌得100萬美元，開始了他的新事業。該團隊的目標是構建一個基於Windows平台的易於使用且價格合理的軟體。 \n 2005年 \n \n 繪圖比較，為用戶提供工具來比較兩個圖紙之間的變化。 \n Flex功能。 \n 電氣布線，與管道布線一起使用。 \n 在圖紙中自動標註，以捕捕捉模型中已定義的尺寸。 \n 能夠繪製無限的線條。 \n SolidWorks Rx發布，旨在提供幫助技術支持更好地去識別問題。 \n \n 2006年 \n \n 發布Smart Components功能，允許為硬體之類的物件安裝智能裝配組件。 \n 介紹填充圖案。 \n 介紹草圖塊。 \n 顯示狀態。 \n 設計檢查器，允許用戶根據公司標準動態檢查他們的模型。 \n 添加了相機視圖功能。 \n 發布SolidWorks Office Premium（白金版）軟體包，包括Routing，COSMOSWorks和 COSMOSMotion進行模擬，以及ScanTo3D。 \n \n 2007年 \n \n SWIFT工具可幫助設計人員在提供自動化解決方案時動態了解模型存在問題或錯誤的原因。 \n 可在組件中使用皮帶，鏈條和齒輪功能。 \n 用於表面處理的自由形式命令。 \n 介紹Enterprise PDM。 \n \n 2008年 \n \n \n 使用新的菜單欄和CommandManager布局對用戶介面進行全面檢修和現代化優化。上下工具欄和快捷工具欄首次可用。所有這些介面組件現在都可以完全自定義。 \n Instant3D，提供拖動和操縱幾何體的功能，可輕鬆測試不同的設計概念。 \n 發布TolAnalyst。 \n 設計剪貼畫，通過剖析現有數據以便在另一個模型中重複使用，可以更輕鬆地重用現有的2D和3D數據。 \n 推出DriveWorksXpress和DFMXpress。 \n \n 2009年 \n \n PhotoView360圖像渲染作為第一個渲染器引入，以訪問處理器的多核功能。 \n SpeedPak現在可用於簡化裝配中的組件。 \n 為追求更高目標，所以引入傳感器。 \n CircuitWorks發布並添加到SolidWorks Office Premium（白金版）軟體包中。 \n 發布3DVIA Composer。 \n \n 2010年 \n \n 現在提供可持續發展方案，幫助用戶了解其設計對環境的影響。 \n 快速標註尺寸使得創建細節圖更加容易。 \n 介紹基於事件的運動模擬。 \n 首次提供滑鼠手勢快捷鍵。 \n 現在可以進行多體鈑金建模。 \n \n 2011年 \n \n PhotoView360完全集成到SolidWorks介面中。 \n 現在可以使用Walk-through（走查）功能。 \n 引入了Defeature工具以幫助限制模型中的智慧財產權數量。 \n 現在可以在Simulation中使用平面簡化。 \n 自動排列圖紙中的尺寸。 \n \n 2012年 \n \n 方程式編輯器經過徹底檢修後，更加用戶友好。 \n 介紹Large Design Review。 \n Feature Freeze現在可以讓用戶更好地控制性能。 \n 鈑金增強：邊線法蘭的更多選擇，引入掃描法蘭，使用的成型工具更加人性化。 \n 發布成本計算加載項。 \n \n 2013年 \n \n View Orientation有一個對話框，不再只是在工具欄上了。還引入了選擇器多維數據集以及保存視圖功能以便之後使用。 \n 以前的版本文件互操作性：2013文件現在可以在2012 SP5中打開。 \n 介紹Conic草圖實體。 \n 相交功能。 \n Customer Portal（客戶門戶網站）上提供了CAD Admin Dashboard（CAD管理員儀錶板）。 \n \n 2014年 \n \n 能夠通過上下工具欄快捷方式添加標準配合。 \n 替換草圖實體使用戶能夠用新的實體替換舊實體並仍然維護下游引用。 \n 推出了鈑金中的Lofted Bend功能。 \n 能夠創建Conic Fillets（圓錐倒角）。 \n 樣式樣條草圖命令。 \n 自動縮放第一個草圖。現在，在草圖上創建第一個維度時，所有實體都會自行調整大小以進行縮放。 \n 能夠配置結構成員配置文件。現在允許配置輪廓草圖，這大大改變了需要組織的文件數量。 \n MySolidWorks作為能夠提供自學培訓以及所有SolidWorks的在線資源社區發布。 \n \n 2015年 \n \n \n 動態參考可視化，幫助用戶了解父/子關聯。 \n 引入了選擇集，以便於重複使用幾何選擇組合。 \n 能夠直接從SolidWorks進行3D列印。 \n Simulation中的疲勞分析。 \n Profile center mate（輪廓中心配合）。 \n 發布SolidWorks MBD。 \n \n 2016年 \n \n 用戶介面重新設計，包括更好地支持高解析度顯示器。 \n 藍色/灰色盤默認採用傳統配色方案。 \n 引入了選擇麵包屑，使相關命令更易於訪問。 \n 實現Mate Controller工具，以更加可訪問的方式捕捉裝配定位。 \n 能夠全局替換失敗的配合實體。 \n 介紹Thread功能。 \n 發布PDM Standard（標準版）並添加到SolidWorks Professional專業版軟體包中。 \n SolidWorks Visualize作為獨立的圖片渲染應用程式發布。 \n \n 2017年 \n \n 引入3D互連以簡化不同文件類型與SolidWorks的協作。 \n Asset Publisher具有ground plane（地層）和magnetic mates（磁配對），可輕鬆實現大型裝配布局。 \n 引入了Advanced Hole（高級孔）功能。 \n 增強了Wrap功能，可在更多類型的面選擇上創建幾何體。 \n 陰影草圖輪廓增強選擇和操作功能。 \n \n 2018年 \n \n SolidWorks啟動時的歡迎對話框。 \n 用戶設置現在可以登錄。新發布的在線許可也可以遵循此登錄，在需要在多台計算機上使用SolidWorks時為用戶提供另一種選擇。 \n 選擇幾何圖形，允許用戶忽略幾何圖形並在其上選擇其他實體。 \n 引入了標籤和插槽功能，自動執行以前在鈑金和焊件中常用的手動方法。 \n 能夠鏡像3D草圖中的實體。 \n 首次使用筆，觸屏和基於手勢的草圖繪製功能。 \n 引入拓撲仿真分析。 \n \n 2019年 \n \n 顯著改進裝配性能。 \n Silhouette defeature命令，簡化了從模型中刪除細節以提高性能或保護智慧財產權的過程。 \n 能夠按狀態對mates進行分組。 \n 部分倒角和圓角。 \n 將圖像轉換為網格/凹凸貼圖，從圖像文件創建實際的3D幾何體。 \n \n \n', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'NX', 'text': '1960年，McDonnell Douglas Automation 公司成立。 1976年，收購了Unigraphics CAD/CAE/CAM系統的開發商——United Computing公司，UG的雛形問世。 1983年，UG 上市。 \n 1986年，Unigraphics吸取了業界領先的、為實踐所證實的實體建模核心——Parasolid的部份功能。 1989年，Unigraphics宣布支持UNIX平台及開放系統的結構，並將一個新的與STEP標準兼容的三維實體建模核心Parasolid引入UG。 1990年，Unigraphics作為McDonnell Douglas（波音飛機公司）的機械CAD/CAE/CAM的標準。 1991年，Unigraphics開始了從CAD/CAE/CAM大型機版本到工作站版本的轉移。 1993年，Unigraphics引入複合建模的概念，可以實體建模、曲線建模、框線建模、半參數化及參數化建模融為一體。 1995年，Unigraphics首次發布了Windows NT版本。 1996年，Unigraphics發布了能自動進行干涉檢查的高級裝配功能模塊、最先進的CAM模塊以及具有A類曲線造型能力的工業造型模塊：它在全球迅猛發展，占領了巨大的市場份額，已經成為高端及商業CAD/CAE/CAM應用開發的常用軟體。 1997年，Unigraphics新增了包括WAVE（幾何連結器）在內的一系列工業領先的新增功能。WAVE這一功能可以定義、控制、評估產品模板，被認為是在未來幾年中業界最有影響的新技術。 2000年，Unigraphics發布了新版本的UG17，最新版本的，是UGS成為工業界第一個可以裝載包含深層嵌入「基於工程知識」（KBE）語言的世界級MCAD軟體產品的供應商。 2001年，Unigraphics發布了新版本UG18，新版本對舊版本的對話框進行了調整，使得在最少的對話框中能完成更多的工作，從而簡化了設計。 2002年，Unigraphics發布了 UG NX1.0 .新版本繼承了UG18的優點，改進和增加了許多功能，使其功能更強大，更完美。 2003年，Unigraphics發布了新版本 UG NX2.0 \xa0 。新版本基於最新的行業標準，它是一個全新支持PLM的體系結構。EDS公司同其主要客戶一起，設計了這樣一個先進的體系結構，用於支持完整的產品工程。 2004年，Unigraphics發布了新版本的 UG NX3.0 ，它為用戶的產品設計與加工過程提供了數字化造型和驗證手段，。它針對用戶的虛擬產品的設計和工藝設計的需要，提供經過實踐驗證的解決方案。 2005年，Unigraphics發布了新版本的 UG NX4.0 .它是嶄新的NX體系結構，使得開發與應用更加簡單和快捷。 \n 2007年04月， UGS公司發布了 NX 5.0 \xa0 – NX的下一代數字產品開發軟體，幫助用戶以更快的速度開發創新產品，實現更高的成本效益。 2008年06月，Siemens PLM Software發布 UG NX 6.0 ，建立在新的同步建模技術基礎之上的NX 6將在市場上產生重大影響。同步建模技術的發布標誌著NX的一個重要里程碑，並且向MCAD市場展示Siemens的鄭重承諾。 NX 6將為我們的重要客戶提供極大的生產力提高。 2009年10月 – 西門子工業自動化業務部旗下機構、全球領先的產品生命周期管理（PLM）軟體與服務提供商Siemens PLM Software 宣布推出其旗艦數字化產品開發解決方案NX 軟體的最新版。 UG NX 7.0 引入了「HD3D」（三維精確描述）功能，即一個開放、直觀的可視化環境，有助於全球產品開發團隊充分發掘PLM信息的價值，並顯著提升其制定卓有成效的產品決策的能力。此外，NX 7.0還新增了同步建模技術的增強功能。修復了很多6.0所存在的漏洞，穩定性方面較6.0有很大的提升。 2010年5月20日– Siemens PLM Software在上海世博會發布了功能增強的NX7最新版本（ UG NX 7.5 ），NX GC 工具箱將作為NX 7最新版本的一個應用模塊與NX 7一起同步發布。NX GC 工具箱是為滿足中國用戶對NX特殊需求推出的本地化軟體工具包。在符合國家標準（GB）基礎上，NX GC 工具箱做了進一步完善和大量的增強工作。 2011年09月 - Siemens PLM Software發布了 UG NX 8.0 2012年10月 - Siemens PLM Software發布了 UG NX 8.5 2013年10月- Siemens PLM Software發布了 UG NX 9.0 2014年8月- Siemens PLM Software發布了 UG NX 10.0 2016年8月- Siemens PLM Software發布了 UG NX 11.0 2017年10月- Siemens PLM Software發布了 UG NX 12.0 \n', 'tags': '', 'url': 'NX.html'}, {'title': 'Inventor', 'text': '應用 \n 由於Autodesk Inventor Professional集所有這些產品於一體，因此提供了一個無風險的二維到三維轉換路徑，您能以自己的進度轉換到三維，保護的二維圖形和知識投資，並且清楚地知道自己在使用目前市場上DWG兼容性最強的平台。 Autodesk Inventor Professional軟件是一套全面的設計工具，用於創建和驗證完整的數字樣機；幫助製造商減少物理樣機投入，以更快的速度將更多的創新產品推向市場。 \n Autodesk Inventor產品系列正在改變傳統的CAD工作流程：因為簡化了複雜 三維模型 的創建，工程師即可專注於設計的功能實現。 通過快速創建數字樣機，並利用數字樣機來驗證設計的功能，工程師即可在投產前更容易發現設計中的錯誤。 Inventor能夠加速概念設計到產品製造的整個流程，並憑藉著這一創新方法，連續7年銷量居同類產品之首。 \n 適用於設計流程的理想工具 \n Autodesk Inventor Professional軟件支持設計人員在三維設計環境中重複使用其現有的DWG 資源，體驗數字樣機帶來的便利。 Inventor 可以直接讀寫DWG 文件，而無需轉換文件格式；利用寶貴的DWG資源來創建三維零件模型，這是一種前所未有的體驗。 Autodesk Inventor Professional軟件中不僅包含豐富的工具，可以輕鬆完成三維設計，還可以與其他廠商的製造業軟件實現良好的數據交互，從而簡化客戶與其他公司的協作。 \n 滿足設計需求的專用工具 \n Autodesk Inventor Professional提供了一套全面、集成的設計工具，可用於創建完整的數字樣機，以驗證設計的外型、結構和功能。 Inventor創建的模型是一種精確的三維數字樣機，支持用戶在工作過程中驗證設計和工程數據，盡量減少對於物理樣機的依賴，這將減少進入製造環節後代價高昂的 原型設計 變更。 \n Autodesk Inventor Professional軟件融合了直觀的三維建模環境與功能設計工具。 前者用於創建零件和裝配模型，後者支持工程師專注於設計中的功能實現，並能創建智能零部件，如鋼結構、傳動機構、管路、電纜和線束等。 \n 在投產前為了驗證設計的結果，往往需要花費高昂代價。 而Autodesk Inventor Professional 則具有內嵌的、易於使用的運動仿真和應力分析功能，工程師可以在機器投產前，利用這些功能和數字樣機來優化、預測機器在未來的實際工作情況。 \n 利用已驗證的三維數字樣機來生成製造文檔，有助於在加工前減少錯誤和相關的ECO（工程變更單）。 Inventor可快速、精確地從 三維模型 中生成工程圖。 Autodesk Inventor Professional包含了AutoCAD Mechanical軟件，這是工程師從事高效二維機械繪圖的最佳選擇。 \n Autodesk Inventor Professional與Autodesk 數據管理軟件的密切集成，有利於高效安全地交流設計數據，便於設計團隊與製造團隊及早開展協作。 各個團隊都可以利用免費的Autodesk Design Review軟件（評審、測量、標記和跟踪設計）來管理和跟踪數字樣機中的所有零部件，從而更好地重複利用關鍵的設計數據、管理物料清單（BOM表），加強與其他團隊及合作夥伴之間的協作。 \n Autodesk推出了不同的產品配置，以滿足客戶具體的功能要求。 沒有一家公司能夠比Autodesk更竭盡全力地幫助設計師們進行創新，並以更低的成本將更好的產品更快地投入市場。 \n \n 版本歷史 \n \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0Autodesk Inventor R1 Mustang 1999/9/20 \u3000\u3000Autodesk Inventor R2 Thunderbird 2000/3/1 \u3000\u3000Autodesk Inventor R3 Camaro 2000/8/1 \u3000\u3000Autodesk Inventor R4 Corvette 2000/12/1 \u3000\u3000Autodesk Inventor R5 Durango 2001/9 /17 \u3000\u3000Autodesk Inventor R6 Viper 2002/10/15 \u3000\u3000Autodesk Inventor R7 Wrangler 2003/4/18 \u3000\u3000Autodesk Inventor R8 Cherokee 2003/10/15 \u3000\u3000Autodesk Inventor R9 Crossfire 2004/7/15 \u3000\u3000Autodesk Inventor R10 Freestyle 2005/4/6 \u3000\u3000Autodesk Inventor R11 Faraday 2006/4/6 \u3000\u3000Autodesk Inventor 2008 Goddard 2007/4/11 \u3000\u3000Autodesk Inventor 2009 Tesla 2008/4/16 \u3000\u3000Autodesk Inventor 2010 Hopper 2009/2/27 \u3000\u3000Autodesk Inventor 2011 Sikorsky 2010/3/26 \u3000\u3000Autodesk Inventor 2012 Brunel 2011/3/22 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2013 發佈於2012 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2014 發佈於2013 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2013 發佈於2012-06-25 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2012 發佈於2011-04-15 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2011 發佈於2010-04-23 \n \xa0 \xa0 \xa0 \xa0 \xa0 Autodesk Inventor Professional 2010 發佈於2009-04-26 \n \n', 'tags': '', 'url': 'Inventor.html'}, {'title': 'Creo', 'text': 'Creo Parametric ，舊稱Pro/ENGINEER，是美國 參數科技公司 （PTC, Parametric Technology Corporation）推出的一款 EDA 工具，主要用於三維製圖、 建模 ，在複雜的 三維模型 設計方面有優勢。該軟體是第一個運用「 參數 化設計」、「 實體造型 」「特徵導向」思想的三維設計軟體，即用有限個數的參數去約束模型，而不用擔心模型有多麼複雜。該軟體運行在WINDOWS上。 \n 為了和新的「 Creo 」設計工具集統一名稱，Pro/ENGINEER在2010年8月改名為「 Creo Elements/Pro 」,2011年6月再改名為「 Creo Parametric 」 \n \n 參考資料:維基百科 \n \n', 'tags': '', 'url': 'Creo.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};